# Commented out IPython magic to ensure Python compatibility.
import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
# %matplotlib inline

credit_data = pd.read_csv("/content/credit_risk.csv")

credit_data.info()

credit_data['class'].unique()

X = credit_data.columns.drop('class')

y = credit_data['class']

credit_data_encoded = pd.get_dummies(credit_data[X])

credit_data_encoded.shape

"""After encoding, the number of predictors/features columns have increased. This is because each of the categorical columns has been broken down into multiple columns, one for each of the values it can take.

For example, the original 'purpose' column could take 10 values such as 'education', 'business', etc. After encoding, the 'purpose' column has been replaced by 10 new columns like 'purpose_education', 'purpose_busniess', and so on.

Each of these new columns take either a value 0 or 1.
"""

credit_data_encoded.head()

credit_data_encoded.columns

"""

Splitting Credit Risk data into Training and testing data

"""

from sklearn.model_selection import train_test_split

X_train,X_test,y_train,y_test = train_test_split(credit_data_encoded,y,test_size=0.15,random_state=100)

print(X_train.shape)
print(X_test.shape)
print(y_train.shape)
print(y_test.shape)

#Building the model
from sklearn.linear_model import LogisticRegression

model = LogisticRegression()

model.fit(X_train,y_train)

# Getting the accuracy on training data and Testind data
print("Traing Score",model.score(X_train,y_train))
print("Testing Score",model.score(X_test,y_test))

"""The finding shows that the accuracy on the test data is similar to the training data.
Therefore, it can be assumed that the model is **not overfitting the training data.**

**Measuring Model Performance using Confusion Matrix**

Confusion matrix helps in assessing how good a model is by comparing the actual target values with the predicted target values.
"""

train_prediction = model.predict(X_train)

test_prediction = model.predict(X_test)

from sklearn.metrics import confusion_matrix

# Creating a confusion matrix on the training data
train_conf_matrix = confusion_matrix(y_train,train_prediction)

# Converting the train_conf_matrix into a DataFrame for better readability
pd.DataFrame(train_conf_matrix,columns=model.classes_,index=model.classes_)

# Confusion matrix for the test data
test_conf_matrix = confusion_matrix(y_test,test_prediction)

pd.DataFrame(test_conf_matrix,columns=model.classes_,index=model.classes_)

# Calculating train accuracy from confusion matrix
# train accuracy = no of correct prediction / no of predictions
train_accuracy = (train_conf_matrix[0][0]+train_conf_matrix[1][1])/(train_conf_matrix[0][0]+train_conf_matrix[0][1]+train_conf_matrix[1][0]+train_conf_matrix[1][1])
print("Train Accuracy",train_accuracy)

# Calculating test accuracy from confusion matrix
# test accuracy = no of correct prediction / no of predictions
test_accuracy = (test_conf_matrix[0][0]+test_conf_matrix[1][1])/(test_conf_matrix[0][0]+test_conf_matrix[0][1]+test_conf_matrix[1][0]+test_conf_matrix[1][1])
print("Test Accuracy",test_accuracy)

"""## **Precision, Recall, and F1-score:**

![Screenshot 2025-03-27 125143.png](data:image/png;base64,)

Precision = True+ve /( True+ve + False+ve )


Recall = True+ve / ( True+ve + False-ve)


F1score = 2*(Precision * Recall )/( Precision + Recall )
"""

from sklearn.metrics import classification_report

model_report = classification_report(y_test,test_prediction)
print(model_report)